def fpi_bandpass_lims(d, n):

    lmax = 2 * d * (1 / n + 1 / (2 * n * (n - 1)))
    lmin = 2 * d * (1 / n - 1 / (2 * n * (n - 1)))
    return (lmin, lmax)

