original_code:
def _ExpandTabs(text, column, tabsize, mark_tabs=False):

  expanded = ""
  while True:
    tabpos = text.find("\t")
    if tabpos < 0:
      break
    fillwidth = tabsize - (tabpos + column) % tabsize
    column += tabpos + fillwidth
    if mark_tabs:
      fill = "\t" + " " * (fillwidth - 1)
    else:
      fill = " " * fillwidth
    expanded += text[0:tabpos] + fill
    text = text[tabpos+1:]
  return expanded + text

